    timeFrameLength: "week",
    habitCategory: "body"
  },
  habit2: {
    habit: "meditate",
    timeFrameNumber: 1,
    timeFrameLength: "day",
    habitCategory: "mind"
  },
  habit3: {
    habit: "upload to github",
    timeFrameNumber: 300,
    timeFrameLength: "year",
    habitCategory: "work"
  },
  habit4: {
    habit: "call Mom",
    timeFrameNumber: 1,
    timeFrameLength: "week",
    habitCategory: "relationship"
  }

};

